import React from 'react'
import Card from '../components/Card'
import { useOutletContext } from "react-router-dom";
function Product() {
  const { products,filteredProducts } = useOutletContext();
  return (
    <div>
      <Card product={products} filterdata={filteredProducts}/>
    </div>
  )
}

export default Product
